R["oh__@sasanah"]="{['eu']={[80]={['N']='Aquarium',['D']='An aquarium you never seen before\\n\\nDive into an exhilarating world at the aquarium, each tank revealing unseen aquatic marvels that will leave you breathless. After your awe-inspiring exploration, kick back at the nearby café. The scent of freshly brewed coffee intertwines with the thrill of discovery. Treat yourself to a scoop of ice cream while witnessing the mesmerizing dance of lively fish. A journey beyond the ordinary awaits!\\nIn cooperation with @Kantuuka',['C']=1.012000,['O']=19753,},[25]={['N']='Paradise',['D']='Calm Avenue\\n\\nNestled on a small, quiet street, there\\'s a cozy inn waiting to embrace weary travelers. You can rent a room adorned with charm and simplicity, where the ambiance whispers tales of comfort. As you settle in, savor a bowl of the inn\\'s renowned soup – a warm embrace for the soul. Drift into a deep, peaceful sleep, and awaken refreshed for the day\\'s unfolding adventure.',['C']=1.041000,['O']=19753,},[34]={['N']='Tavern',['D']='Step into the Hallin\\'s Tavern, a haven of good food and rustic charm. For an elevated experience, discover the VIP Lounge, where exquisite dishes and curated cocktails redefine indulgence. Seeking privacy? Rent a room for an intimate escape. Cap off the day with a warm bath, transforming your visit into a truly relaxing retreat at the heart of the Hallin\\'s Tavern.',['C']=1.024000,['O']=19753,},[43]={['N']='Blooming Bites',['D']='Blooming Bites is more than just a place to eat; it\\'s a realm of wonder and magic, inviting adventurers, dreamers, and food lovers to experience the beauty and enchantment of the garden.',['C']=1.020000,['O']=19917,},[68]={['N']='Suite OneOhOne',['D']='Step into a world of comfort in this cozy, little room, where warmth wraps around you like a soft embrace. As you settle into the comforting atmosphere, feel the stresses of the day melt away, leaving only tranquility in their wake.',['C']=1.049000,['O']=19753,},[16]={['N']='The Khajiit Cottage',['D']='Step inside the \"Khajiit Cottage\" and get the feeling of accient Elsweyr',['C']=1.045000,['O']=20002,},[15]={['N']='Crafting House',['D']='Discover a crafting haven at the theme-based crafting house, where creativity knows no bounds. This cozy retreat invites you to immerse yourself in a world of artistic inspiration. Each room tells a unique story, blending warmth with the joy of creation. Whether you\\'re a seasoned artisan or a novice, this charming space promises a cozy atmosphere to bring your imaginative endeavors to life.',['C']=1.009000,['O']=19753,},},['Key']='oh__@sasanah',['Version']=1773,['TS']=1728241714,}"
