o, I have seen nothing.  I only saw someone with a rawing boat shipping in direction to the harbour.',['name']='Field worker',},['X']=71736.575309,['Y']=29104,['Yaw']=5.759587,['Alpha']=1,['Color']=999998,['Z']=59547.234441,['Pitch']=0,},[86]={['Id']=1347,['Contrast']=1,['Groups']=0,['SizeY']=260,['SizeX']=102.790698,['Roll']=0,['SizeZ']=260,['EffectType']=5071,['MetaData']={['message']='Willkommen in meiner Arena. Lust auf einen Kampf oder eine Wette?\\n',['name']='Arenaleiter',},['X']=67226.061457,['Y']=29285,['Yaw']=3.577925,['Alpha']=1,['Color']=999998,['Z']=74345.841390,['Pitch']=0,},[87]={['Id']=1353,['Contrast']=1,['Groups']=0,['SizeY']=235,['SizeX']=90,['Roll']=0,['SizeZ']=235,['EffectType']=5012,['MetaData']={['message']='Hallo, ich möchte mit Dir ein kleines Spiel spielen *grins*\\nDu siehst hinter mir diesen großen bösen Daedroth? Ja? Du wirst jetzt gegen ihn kämpfen müssen und ich sage Dir wie:\\n\\nDu würfelst mit /dice im chat eine Zahl. Wenn Du eine Zahl unter 10 würfelst, fehlt Dir plötzlich 1 Arm, wenn du aber sogar unter 3 würfelst, bist du schweeeeeerstens verletzt und musst schnell in ein Krankenhaus. Hm, Krankenhaus haben wir hier gar nich, ok dann musst du schnell nochmal würfeln, ob Du es überhaupt zu einem Haus oder sogar zu einem Arzt schaffst. Verstanden? Würfels Du über 10, entkommst Du wenigstens wieder von hier. Unter 10 würfeln empfehle ich Dir nicht, denn dann stirbst Du hier auf der Stelle und wirst Wurmfutter. Zack, biste erledigt. So schnell geht das *hihi*\\nWürfelst Du von Anfang an aber über 10, gewinnst Du den Kampf, bekommst die Prinzessin als Belohnung und darfst wieder zurück in Dein eigenes Königreich. Na, wie gefällt Dir das? *hihi*',['name']='Kleines ungezogenes Mädchen',},['X']=57194.019352,['Y']=29116,['Yaw']=2.879793,['Alpha']=1,['Color']=696968,['Z']=69956.649703,['Pitch']=0,},[88]={['Id']=1355,['Contrast']=1,['Groups']=0,['SizeY']=220,['SizeX']=90.378378,['Roll']=0,['SizeZ']=220,['EffectType']=5079,['MetaData']={['mes