r something or someone. I .. I see a journey. Stop. It´s a journey far away from here...a boat or a caravan. I can\\'t see clearly. Hm. The person... the person, it is you or the person you are looking for. ***The oracle turns his eyes back again and stops to breathe hard*** Ok, you´ve got it, my friend? If you wish, you can send 200 gold pieces @Halvarock for this hint.',['name']='Das Orakel',},['X']=83966.778074,['Y']=29023,['Yaw']=3.984587,['Alpha']=1,['Color']=696968,['Z']=73606.461941,['Pitch']=0,},[169]={['Id']=1526,['Contrast']=1,['Groups']=0,['SizeY']=80,['SizeX']=780,['Roll']=0,['SizeZ']=80,['EffectType']=4407,['MetaData']={['message']='Journey to: Laboratoy \"Cyrodelisches Dschungelhaus\"  in Malabol Tor.',},['X']=73579.656540,['Y']=29579,['Yaw']=5.969026,['Alpha']=1,['Color']=99,['Z']=70749.671563,['Pitch']=0,},[170]={['Id']=1528,['Groups']=0,['Contrast']=1,['SizeX']=1172,['Roll']=0,['SizeZ']=1224,['EffectType']=495,['SizeY']=1224,['X']=71940.184582,['Y']=29654,['Yaw']=2.459169,['Alpha']=1,['Color']=999998,['Z']=62844.454753,['Pitch']=0,},[171]={['Id']=1531,['Groups']=0,['Contrast']=1,['SizeX']=1100,['Roll']=0,['SizeZ']=1200,['EffectType']=5134,['SizeY']=1200,['X']=70487.974143,['Y']=29671,['Yaw']=2.427753,['Alpha']=0.660000,['Color']=747999,['Z']=61720.292158,['Pitch']=1.570971,},[172]={['Id']=1532,['Groups']=0,['Contrast']=1,['SizeX']=1192,['Roll']=0,['SizeZ']=1224,['EffectType']=495,['SizeY']=1224,['X']=73761.915241,['Y']=29695,['Yaw']=1.631883,['Alpha']=1,['Color']=999998,['Z']=67568.442502,['Pitch']=0,},[173]={['Id']=1533,['Groups']=0,['Contrast']=1,['SizeX']=1143,['Roll']=0,['SizeZ']=1224,['EffectType']=495,['SizeY']=1224,['X']=68101.663670,['Y']=30388,['Yaw']=2.528982,['Alpha']=1,['Color']=999998,['Z']=64034.179443,['Pitch']=0,},[174]={['Id']=1534,['Groups']=0,['Contrast']=1,['SizeX']=1172,['Roll']=0,['SizeZ']=1224,['EffectType']=495,['SizeY']=1224,['X']=69602.630344,['Y']=30414,['Yaw']=2.546435,['Alpha']=1,['Color']=999998,['Z']=65060.103261,['Pit