waters. So, don´t be afraid, ask the skipper downstairs, at  the moment he sails in safe waters to the coast of high isle. \\nIf you wish, you can later pay for your journey and send 500 gold pieces @Halvarock ;-)',['name']='Harbour Master and Commander',},['X']=77071.925290,['Y']=29972,['Yaw']=0.460767,['Alpha']=1,['Color']=696968,['Z']=51961.217894,['Pitch']=0,},[182]={['Id']=1547,['Contrast']=1,['Groups']=0,['SizeY']=300,['SizeX']=120,['Roll']=0,['SizeZ']=300,['EffectType']=5016,['MetaData']={['message']='Hey,you see what hapened here?  I am Jorn. I lead the investigation of this crime scene and perhaps you can help me to crack this damn case. Sure you can! You are looking intelligent. I have to catch the abusers and find the loot. Some filthy bastards robbed and slayed these men and stole a very big part of the delivery for the village. You can ask the citizens or the craftsmen, what is missing. Perhaps you also find witnesses, who saw someone who fled. Each tray would be worthful.\\n\\nSo here are your instructions, my friend: Find these terroristss and find the loot, the whole loot. When you have done all, inform my boss @Halvarock. He will pay you a nice reward. And now, good luck and thank you for your support!',['name']='Inspector Jorn',},['X']=66309.588271,['Y']=29244,['Yaw']=4.239405,['Alpha']=1,['Color']=696968,['Z']=61320.221505,['Pitch']=0,},[183]={['Id']=1548,['Contrast']=1,['Groups']=0,['SizeY']=333.492647,['SizeX']=193.782383,['Roll']=0,['SizeZ']=333.492647,['EffectType']=5015,['MetaData']={['message']='Hey listen! I awaited a very important delivery. Weapons to repair.  The customer would have paid a big bunch of gold pieces to me for this order. Ah wha do I say, you know the Jarl? He pays very good for the orders I do for him. But do you know what happened? Some kind of filthy dirty assholes made an assault on the caravan to the village. These dirty Bastards! You know what these weapons are woth? Sure not. It is a half wealth they robbed. I can tell you. .............. It was a brilliant copy of the sword of Tho\\'at Replicanum,  a yokudanic Skystone Edge  and a blade of a Sorcerer King. A KING, you heard!?! Hope the Jarl will find competent people to find them again and these suckers of fithy thieves.',['name']='Smith',},['X']=73898.706910,['Y']=29153,['Yaw']=4.392994,['Alpha']=1,['Color']=696968,['Z']=69659.578558,['Pitch']=0,},[184]={['Id']=1551,['Contrast']=1,['Groups']=0,['SizeY']=260,['SizeX']=123.664717,['Roll']=0,['SizeZ']=260,['EffectType']=5074,['MetaData']={['message']='Hi, I am the tailor. You want new clothes? Have look at my store. There in the corner you can try on the clothes.\\nThe assault you ask for? No, I do not know much, but I heard, the smith is very angry about it.',['name']='Tailor',},['X']=72418.969487,['Y']=29093,['Yaw']=5.133013,['Alpha']=1,['Color']=990098,['Z']=62896.621994,['Pitch']=0,},[185]={['Id']=1552,['Contrast']=1,['Groups']=0,['SizeY']=235,['SizeX']=90,['Roll']=0,['SizeZ']=235,['EffectType']=5010,['MetaData']={['message']='Ich bin der Zimmermann. Ich werde dir etwas erzählen.',['name']='Zimmermann',},['X']=73886.292575,['Y']=29093,['Yaw']=4.267330,['Alpha']=1,['Color']=696969,['Z']=67952.609871,['Pitch']=0,},[186]={['Id']=1554,['Contrast']=1,['Groups']=0,['SizeY']=260,['SizeX']=102.790698,['Roll']=0,['SizeZ']=260,['EffectType']=5071,['MetaData']={['message']='You wanna have a look at my laboratory and my ingredients in my garden? Take the gate',['name']='Alchemist',},['X']=73524.110260,['Y']=29093,['Yaw']=3.820526,['Alpha']=1,['Color']=999998,['Z']=71459.804362,['Pitch']=0,},[187]={['Id']=1556,['Contrast']=1,['Groups']=0,['SizeY']=220,['SizeX']=90.378378,['Roll']=0,['SizeZ']=220,['EffectType']=5079,['MetaData']={['message']='You need something to enchant? Here you are right! \\nThe assault? I just know, that the smith awaited a very important delivery from the Jarl.  If you want to visit the Jarl, there behind the big drinking hall is a way to his fortress.',['name']='En