 us and you sure can make some business with them. So come on board.',['name']='Skipper to Hundings Palace',},['X']=73029.366156,['Y']=29966,['Yaw']=1.110029,['Alpha']=1,['Color']=696968,['Z']=50220.995689,['Pitch']=0,},[255]={['Id']=1672,['Contrast']=1,['Groups']=0,['SizeY']=260,['SizeX']=106.716418,['Roll']=0,['SizeZ']=260,['EffectType']=5066,['MetaData']={['message']='Hey, you want to travel to our Merchants place at summersend? Come on board. Guess, you can make some business.',['name']='Skipper to Aldmerische Grotte',},['X']=75833.402934,['Y']=29963,['Yaw']=5.443682,['Alpha']=1,['Color']=999999,['Z']=48102.017173,['Pitch']=0,},[256]={['Id']=1674,['Contrast']=1,['Groups']=0,['SizeY']=235,['SizeX']=90,['Roll']=0,['SizeZ']=235,['EffectType']=5012,['MetaData']={['message']='Yes, I am working here. Master Azandar will sure come back again in a few minutes, I think. Believe, he is on the way back from the alchemist or the enchantress. He wanted to buy something. Or he is again doing something nuts with Lady Funke at the moon gate. (Think she is really nuts. Few times she#s telling us of myterious prophecies of an oracle in the woods). Often they talk there about star rituals and such crazy things. When he is back, you can travel with our portals to the damn big library in Skyrim, yep nearly the HOLE library of Tamriel we collected there.  The other portal ports you to the faculty of Lady Vijehl Tzu Thun in a little village at Rivenspire. She teaches there many things about magic, alchemy, medicine, astronomy and such interesting things. She is a wonderful teacher. I am one of her pupils and I live there at the moment and so it comes that I work sometimes over here.',['name']='Little sorcerers apprentice',},['X']=61319.937978,['Y']=32415,['Yaw']=2.445206,['Alpha']=1,['Color']=696968,['Z']=57006.887875,['Pitch']=0,},[257]={['Id']=1711,['Contrast']=1,['Groups']=0,['SizeY']=220,['SizeX']=80,['Roll']=0,['SizeZ']=220,['EffectType']=5019,['MetaData']={['message']='Naaaah, f