R["oh__@the-cawckiest.king"]="{['TS']=1724363337,['na']={[63]={['D']=' - or \"Twin Birds\\' Peak\". An isolated mountaintop north, bitten by the updraft chill of the Sea of Ghosts and once the site of a Mound left over from the days of the Dragon War. Now it houses a small home nested inside the belly of the stone itself, and seems to have changed hands many times, only ever belonging to those motivated enough to brave the mountain first, and far too remote for anyone to track who such individuals might be.',['N']='Fridane-Enn Cnoss',['C']=1.007000,['O']=19008,},[71]={['D']='A dangerous stretch of forest, swamp, and mountains in the Hunting Grounds used by followers of Hircine wanting to test themselves and their capabilities... or die trying.',['N']='Wolf\\'sFall-HuntGrnds',['C']=1.007000,['O']=19957,},[86]={['D']='Once the retreat of a group of alchemists, who established a mill and greenhouses for the production and sale of ingredients (definitely not for the Dark Brotherhood\\'s purposes!), then abandoned for years after their deaths out of fear for hauntings. Now under new ownership, with a recently constructed dock to boot, the ruins serve as a trade stop for goods that were definitely acquired through legal means, including locally-grown ingredients for only the most legitimate buyers!',['N']='Golden Bird Landing',['C']=1.007000,['O']=19001,},[83]={['D']='There are few places in Tamriel that welcome a temple to one of the Daedric Princes, or the Great Spirits, as Reachfolk know them; a unique opportunity only Markarth can provide. Opened in 2E 589 by the Kråke Clan, following the events of the Gray Host, and a war with a Malacath Orc cult, the Nozarga. The Temple is for those who revere the Night Mistress and Patron of Thieves, Nocturnal, to do so openly, as well as a place to share drinks and meet others who work in the shadows comfortably.',['N']='ReachNocturnalTemple',['C']=1.007000,['O']=19957,},},['Key']='oh__@the-cawckiest.king',['Version']=1773,}"
