R["oh__@renegadevalor"]="{['Key']='oh__@renegadevalor',['Version']=1773,['TS']=1722693713,['eu']={[34]={['D']='Tuscany in late spring is a unique place to visit. Enjoy the sunny climate in one of the side streets.',['C']=1.034000,['O']=19453,['N']='Tuscany late spring',},[37]={['D']='',['C']=1.050000,['O']=19189,['N']='Modern apartment',},[70]={['O']=18697,['N']='Hall of Fabrication',},[8]={['O']=18716,['N']='Herbalist Grotto',},[10]={['O']=18679,['N']='Dhalmora House',},[11]={['D']='This house belongs to the argonian arcanist, Soaked-in-knowledge.',['C']=1.026000,['O']=19513,['N']='Stormhold House',},[44]={['D']='Just a casual garden :) Feel free to visit!',['C']=1.021000,['O']=19552,['N']='Redoran Home',},[13]={['D']='',['C']=1.020000,['O']=19141,['N']='Enchanted Grotto',},[78]={['C']=0,['O']=18756,['N']='Solitude Townhouse',},[15]={['D']='',['C']=1.021000,['O']=19156,['N']='Cottage in the woods',},[16]={['D']='Artisan house and work place',['C']=1.030000,['O']=19168,['N']='Daggerfall House',},[19]={['D']='Welcome in a pierate cabin! Join the crew and drink the finest rum.',['C']=1.015000,['O']=19560,['N']='Pirate Cabin',},[21]={['D']='',['C']=1.026000,['O']=19445,['N']='Dres plantation',},[25]={['D']='Welcome  traveler! Come take a sit at the camp before you hike mountains. At the end of your journey you will find a warm montain shelter serving beer and hot ribs. Who know? Maybe you will get a sweetroll too :)',['C']=1.031000,['O']=19253,['N']='Baandari House',},[26]={['D']='Mercenarys hideout and treassure room',['C']=1.026000,['O']=19224,['N']='Cyrodiil Gatehouse',},[91]={['D']='There is a basement in this house, please don\\'t miss it :)',['C']=1.002000,['O']=19504,['N']='Lakeside Cottage',},[28]={['D']='Come children! Come travelers! Visit old granny and try her sweets she made for you. But remember child... Don\\'t stare too long...',['C']=1.038000,['O']=19282,['N']='Granny House',},[29]={['D']='We can\\'t wait here outside. We\\'d sooner freeze than wait fo