R["oh__@holygraell"]="{['Version']=1773,['TS']=1714382923,['na']={[1]={['N']='Puck\\'s Repose',['D']='Made in loving memory of my kitty boy, Puck. 10/18 - 5/23. Full of all his favorite things. I miss you, my warm and furry little friend.',['C']=1.029000,['O']=19646,},[2]={['N']='Home Away From Home',['D']='',['C']=1.051000,['O']=19815,},[3]={['N']='Under Mephala\\'s Gaze',['O']=18408,},[5]={['N']='Salome\\'s Penthouse',['D']='',['C']=1.051000,['O']=19804,},[6]={['N']='Mad God\\'s Joke',['D']='Last journal entry of  unknown adventuer -- Key won\\'t work. Innkeeper Jyygy swore I\\'d love the room, newly redone he said. All lies! Skeevers will eat the cheese. I\\'m a WABBAJACK skeever now. Someting stung me, I think. I\\'m so hungry but bad little skeevy weevers aren\\'t allowed cheese. ',['C']=1.026000,['O']=19842,},[7]={['N']='Adventurer\\'s Rest',['O']=18434,},[8]={['N']='The Mistress\\'s Manor',['O']=18408,},[10]={['N']='Argonian Gourmand\\'s',['D']='The humble home of an Argonian \"foodie\". As always my homes are open to RP\\'ers who want to hang out and use them for RP. Make yourself at home! ',['C']=1.051000,['O']=19826,},[13]={['N']='Lua\\'Shan\\'s Snug Home',['D']='The Bosmer Warden, Lua\\'Shan, lives here... when she\\'s not on the road exploring Tamriel. There is always a map open where she likes to sit and plan her next adventures, talking them over with friends.',['C']=1.051000,['O']=19837,},[42]={['N']='Dragons Love Luxury',['O']=18450,},[37]={['N']='The Crafter\\'s Home',['D']='This estate has a glowing meditation garden, crafting stations, a merchant, and a bank, along the side stables, gaurds and employees.  Upgrades to come as soon as I can afford the new master crafting stations and a transmute station as well. It\\'sa great home for the master craftsperson.',['C']=1.021000,['O']=19692,},[58]={['N']='Chapel of the Ladies',['O']=18408,},[19]={['N']='Dunmer Bontanist\\'s ',['D']='Aedylith, a Dunmer Botanist by trade, loves to bring her favorite plants indoors for the beauty and ease of use and study. Although the peculiar blue glowing vines are threatening to take over.',['C']=1.021000,['O']=19840,},[68]={['N']='Lua\\'shan\\'s Apartment',['O']=18408,},[77]={['N']='Hell Hole',['O']=18557,},[29]={['N']='Relaxing Retirement',['D']='The retirement townhome of an adventurer',['C']=1.051000,['O']=19775,},[34]={['N']='Rich Trader\\'s Home',['O']=18408,},},['Key']='oh__@holygraell',}"
