R["fx__eu__@katierlk__28"]="{['Version']=1773,['TS']=1709575018,['Effects']={[1]={['Z']=40523.004508,['Alpha']=1,['Id']=1015,['Roll']=0,['Groups']=0,['MetaData']={['message']='HAPPY BIRTHDAY I hope you love this surprise, thanks for everything you\\'ve done for me and all the advice you\\'ve given, Katie xxx\\n\\nNomak hope you never change sins you have a good heart, iceman\\n\\nDear Nomak, I wish you the happiest of birthdays! You\\'ve welcomed me so warmly into the community and the game itself and have shown me what it means to have friends in game. I\\'m always so happy when we\\'re in voice chat, talking about the game stuff but also deep life things. You\\'re a true friend to me and I hope we\\'ll have many years to come in ESO. I also hope it won\\'t take just as long for me to finally understand your accent, :P Happy birthday, your friend Widdly <3\\n\\nCongratz ancient one from the insolent panda\\n\\nTo an amazing person, wishing you all the best for everyday to come, you deserve it, LC\\n\\nI wish you the warmest of birthdays and hope you are surrounded with love and joy, for you bring and give so much of it to others and we are all blessed for knowning you <3, The Hat Hath Spoken\\n\\nNomak, meeting you has been a pleasure and an hour! Happy birthday, and many more! - Lestast x\\n\\nHappy Birthday you Pompy Musha have a good one. Rowdy\\n\\nIn response for all your kindness and generosity, I wish the world always gives you back love, joy and all the things you truly deserve, Morwem x\\n\\nHappy birthday old man. Don\\'t pretend to be 21, we all know you have grandkids :P have a great day and hope you get aposiled as you spoil everyone else- Darth\\n\\nHey Nomak, while we have only known each other for a short time I\\'m glad to say I count you as one of my friends and hope to do alot more stuff with you ingame for years to come, your friend Pro',['title']='Nomak\\'s birthday wishes',},['X']=39515.630770,['Pitch']=6.108650,['SizeZ']=30,['Y']=21272,['Yaw']=3.972370,['Color']=999519,['EffectType']=8502,['Contrast']=3.200000,['SizeX']=26.456460,['SizeY']=30,},[2]={['Pitch']=0,['Id']=1014,['Roll']=0,['Groups']=0,['SizeX']=137,['X']=40020.905820,['Yaw']=4.450590,['SizeZ']=196,['Y']=21251,['Z']=39338.374320,['Color']=949799,['Contrast']=1,['EffectType']=615,['Alpha']=1,['SizeY']=196,},[3]={['Z']=41385.655920,['Alpha']=1,['Id']=1008,['Roll']=0,['Groups']=0,['MetaData']={['message']='HAPPY\\nBIRTHDAY\\nNOMAK <3',},['X']=37970.510100,['Pitch']=0,['SizeZ']=342,['Y']=26604,['Yaw']=3.001970,['Color']=972299,['EffectType']=4404,['Contrast']=1,['SizeX']=300,['SizeY']=342,},[4]={['Roll']=0,['Alpha']=1,['Id']=1020,['Z']=41430.484166,['Groups']=0,['MetaData']={['message']='2024 <3',},['X']=38073.793598,['Contrast']=0.750000,['SizeZ']=60,['Y']=26468,['Yaw']=2.981022,['Color']=869924,['EffectType']=4407,['Pitch']=0,['SizeX']=220,['SizeY']=60,},[5]={['Pitch']=0,['Id']=1022,['Roll']=0,['Groups']=0,['SizeX']=9,['X']=39451.117935,['Yaw']=3.975860,['SizeZ']=20,['Y']=21162,['Contrast']=1,['Color']=321499,['Z']=40399.761126,['EffectType']=643,['Alpha']=1,['SizeY']=20,},[6]={['Roll']=0,['Alpha']=1,['Id']=1023,['Z']=40453.895030,['Groups']=0,['MetaData']={['message']='Happy birthday 2024!!!\\n\\nThank you Nomak for all the fun times we have had and will continue to have in the future! Have a blessed birthday and wonderful year ahead! Mysan x\\n\\nI\\'m glad we have met and I can call you my friend. You are a gift to all who know you. Happy birthday. You deserve every happiness- Neli x\\n\\nHappy birthday dearest Nomak. I hope your special day is full of fun and laughter.. just like you bring to me and the Misfit\\'s chat. Have a wonderful, happy and healthy birthday. Hugs from Loyalty\\n\\nHappy birthday, and thanks for being your awesome self! Have the best day ever-Kindiz\\n\\nHappy birthday Nomak! Best wishes for the year ahead! Thanks for being an amazing role model! You always help me feel at home in the guild, TinkerbellNZ',['title']='Volume 2- Nomak\\'s birthday wishes ',},['X']=39448.493881,['Pitch']=0,['SizeZ']=30,['Y']=21272,['Yaw']=3.288200,['Color']=990793,['EffectType']=8502,['Contrast']=3.540000,['SizeX']=26.456456,['SizeY']=30,},},}"
