R["oh__@ah'satan"]="{['na']={[33]={['N']='PLANNING CHANGES-WIP',['C']=1.007000,['O']=19442,['D']='An cold and lonely keep along the fringes of any civilized lands. The Lord holds onto it with a stubborn grip, fending off attacks and traitors alike. One can often find an execution taking place before the very doors of his home, or the jails full to overflowing. Snow covers the grounds and it slowly decays from the years of weathering, while the graves and old temple crumble to dust below. ',},[36]={['N']='PRIVATEER ROCINATE',['C']=1.015000,['O']=19429,['D']='The Privateer vessel \"Rocinate\" makes dock at a small island off the coast to unload goods & give the pirates & smugglers aboard a little shore leave to satiate their appetites. Soon though, as the wind changes & coin runs short, they will make their way out again to ply their trade along the high seas. [This is a large, three tiered vessel, recently rebuilt & refitted in dry dock with ample space for crew, Captain & Goods]',},[69]={['N']='BAG-END IN HOBBITON',['C']=1.007000,['O']=19436,['D']='In a hole in the ground there lived a hobbit. Not a nasty, dirty, wet hole, filled with the ends of worms and an oozy smell, nor yet a dry, bare, sandy hole with nothing in it to sit down on or to eat: it was a hobbit-hole, and that means comfort. Welcome inside Bag-End, home of that most famous of Hobbits. Accessible through Hobbiton [Ald Velothi EHT Portal behind the Hobbit Hole Door to include a return portal in Jode\\'s] and is part of my series of Lord of the Rings themed homes. [LOTR]',},[38]={['N']='THE DARK MANSE',['C']=1.048000,['O']=19466,['D']='The Dark Manse is home to a Lady whose family has controlled these lands for long, long years or if rumor is to be believed, it has been her alone, cursed by that plague of man & mer known as Vampirism. In the gothic splendor of it\\'s courtyard lies an Inn with Tavern, Jail, Observation Tower, Stables & Temple--whilst below lies a busy Harbour full of Ships & Commerce. Within the towering home, few have entered unbidden & even fewer have returned - so beware the Lady & her wrath if you dare..',},[40]={['N']='Isla de las Divinas',['C']=1.007000,['O']=19125,['D']='The island of the Divines is home to a large towered fortress. In its massive vaulted chapel hall lies a shrine while upstairs are offices, barracks and such, while upon the roof lies two watch towers and a massive ballista for defense.\\nIn front and around the tower is a park, fountains, inn, tavern with stage, market, port authority, docks and shipbuilders.',},[41]={['N']='HOUSE SLYTHERIN',['C']=1.020000,['O']=19410,['D']='The Slytherin Dungeon, also known as the Slytherin Common Room, serves as an escape, to study & rest, from the other houses at Hogwarts School of Witchcraft & Wizardry for those in Slytherin. These rooms are accessible through the doors at Hogwarts [Pantherfang EHT Portal] This is an addendum for the main Hogwarts build which includes connections to Gryffindor Tower [Domus] Hogsmeade [Snow Globe] The Weasley���s Burrow [Coven] and other locations. (Always working on these, enjoy!)',},[44]={['N']='HOBBITON [LOTR]',['C']=1.007000,['O']=19442,['D']='In a hole in the ground there lived a Hobbit. Not a nasty, dirty, wet hole filled with the ends of worms, nor yet a dry, bare, sandy hole with nothin in it to sit on or to eat. It was a Hobbit Hole & that means comfort. Welcome to the town of Hobbiton and the main residence of Bag-End under the hill. Please enjoy, an unexpected party is still a party nonetheless.',},[75]={['N']='HUFFELPUFF BASEMENT',['C']=1.020000,['O']=19431,['D']='The Hufflepuff Basement is entered through barrels to be found on a side corridor at Hogwarts [Pantherfang]. A passage travels a little way into a warm & cosy round room decorated in earthy tones & tiled floors with dorms for the girls & boys as well as a parlor, kitchen & greenhouse. These are an add-on accessible through Hogwarts [EHT Portals] and part of the build which includes Gryffindor [Domus] Hogsmeade [Globe] The Weasley’s [Coven] Slytherin [Earthtear] Ravenclaw [Coldharbor] & others',},[12]={['N']='WEATHERTOP - LOTR ',['C']=1.007000,['O']=19280,['D']='\"On the top they found a wide ring of ancient stonework, now crumbling or covered with age long grass.\" Weathertop was the highest & southernmost summit of the Weathe Hills & for many centuries the once great fortress stood in ruins upon it, the locals paying little heed, as it faded back into obscurity--with permission, based off the great EU design work of @encyclopedique',},[45]={['N']='HOUSE GRYFFINDOR',['C']=1.020000,['D']='Once you’ve arrived inside Gryffindor House; come inside and be welcomed by the roaring fire, stuffed armchairs, and the great view we have from our windows. Our dormitories are reached by climbing the tall winding staircase to our rooms. This tower serves as common room for House Gryffindor at Hogwarts [Pantherfang] and are part of the main Hogwarts build which includes Ravenclaw [Coldharbor] Huffelpuff [Forge] Hogsmeade [Globe] The Weasley’s [Coven] Slytherin [Earthtear] & others.',['O']=19658,},[76]={['N']='THE HOUSE OF SHADOWS',['C']=1.007000,['O']=19034,['D']='The \"House of Shadows\" located in a secluded cleft in the desert of Alik\\'r is home to a smugglers den of some repute. Creating their illicit Skooma using their rooftop farms of nightshade and moon sugar for sale in every blackmarket & thieves den from one end of Tamriel to the other. Pools, smoking dens, taverns, entertainments, offices & other rooms lie within this den of iniquity.',},[47]={['N']='RAVENCLAW TOWER',['C']=1.020000,['O']=19427,['D']='The Ravenclaw Common Room was a wide circular room, airier than any Harry had ever seen at Hogwarts. Graceful arched windows punctuated the walls, which were hung with blue & bronze silks, with tables, chairs, fireplaces & statues of marble inside. These rooms are an add-on accessible through Hogwarts [Pantherfang EHT Portals] and part of the main Hogwarts build which includes Gryffindor [Domus] Hogsmeade [Globe] The Weasley’s [Coven] Slytherin [Earthtear] & others. Stairs inspired by MANTISIGN',},[80]={['N']='HELM\\'S DEEP [LOTR]',['C']=1.007000,['O']=19078,['D']='The valley was blocked over its entire width by a walled rampart and fortress, the Hornburg, which extended to the Deeping Wall built across the entrance to the Glittering Caves and consisted of solid rock except for a small culvert which allowed water from the Deeping-stream to pass.\\r\\n\\r\\nA long causeway wound up to the great gate of the fortress, Helm\\'s Deep. Inside the keep there were stables and an armoury, as well as a great hall in the rear which was dug out of the mountainside.',},[49]={['N']='THE WEASLEY\\'S BURROW',['C']=1.020000,['O']=19407,['D']='It looked as though it had once been a large stone pigpen, but extra rooms had been added here and there until it was several stories high & so crooked it looked as though it were held up by magic - which it probably was. A sign at the door read THE BURROW, while hens, pigs and other animals were scrounging around the yard & house. [The home of the Weasley\\'s connects, via floo powder (EHT Portals) to Hogwarts, Hogsmeade & Diagon Alley, among others.]',},[82]={['N']='LIMBO',['C']=1.007000,['O']=18982,['D']='The Realm of Limbo, a planar home to the strange and mysterious, this crumbling fortress is home to the Half Daedric Vampyr illyana Darkchylde and her servants, libraries, labs, ritual spaces and a vampiric den reside within this haunting location and its ethereal riverside garden. Visit at your peril...',},[15]={['N']='INN OF THE LAST HOME',['C']=1.007000,['O']=19449,['D']='The Inn of the Last Home was built in the tops of the massive Vallenwood trees in the years after the Cataclysm and though it was temporarily removed during the War of the Lance, upon the end of the war the massive warrior and his wife Tika rebuilt the inn with its structure blened into its tree with loving care [Dragonlance influence build]',},[37]={['N']='CAPTAIN\\'S QUARTERS',['C']=1.007000,['O']=19470,['D']='The Captains Quarters in Port Royal is where Privateer, Cpt. Harlock, takes rest between voyages upon the seas in his ship, the \"Arcadia\" These rooms take up the entire second story above both the Jail & Harbourmaster\\'s. If ever invited inside you will find a large kitchen with bronze stove & copper sink, as well as a specially built bathroom with shower. Maps, trinkets & discoveries abound within.[This is an add-on interior for Port Royal (Grotto) which leads to many other locations & interior]',},[85]={['N']='BARAD-DUR, MORDOR',['C']=1.007000,['O']=19093,['D']='Far off the shadows of Sauron hung but torn by some gust of wind out of the world, or else moved by some great disquiet within, the mantling clouds swirled and for a moment drew aside & then could be seen wall upon wall, battlement upon battlement,  rising black, blacker and darker than the vast shades amid which it stood, the cruel pinnacles & iron crown of the topmost tower of Barad-dûr. It stared out over the blighted landscape like a wraith sucking all hope & life from the world.',},[86]={['N']='TECHNOMANCY CARRIER',['C']=1.007000,['O']=19097,['D']='',},[81]={['N']='ASAKUSA PREFECTURE',['C']=1.007000,['O']=19118,['D']='The Asakusa Prefectureis home to the Daimyo, Lord Katsumoto and his lady, Sayuri. Within his borders lies a pagoda temple shrine, a tea house with zen garden, a martial arts studio, stables and the main manor home of the Lord and his retinue. Nearby lies the Sakura Shotengai along the Nakamise-dori road and is under the protection of the Tsaesci Daimyo\\'s warriors. [Japanese Inspired]',},[24]={['N']='THE GOVERNOR\\'S MANOR',['C']=1.007000,['O']=19492,['D']='The Manor inside Port Royal [Aldmeri Grotto] belongs to the Governor Swann who is the figurehead in charge of the Port City, though in truth the power resides in the Pirate Captain Harlock whose ship makes berth within. This Manor home exits out into Port Royal itself & allows access to many other sights within the seaside city. [This is an add-on home to Port Royal which connects via EHT portals to the Captains Quarters, the Harbormasters Office, an Assassins HQ and several other locales]',},[89]={['N']='HOGWARTS SCHOOL',['C']=1.007000,['O']=19404,['D']='Hogwarts School of Witchcraft & Wizardy. Built overlooking the water, this school plays host to students all across the world, who learn magic in its halls. From here one might travel to Hogsmeade by the front gate, or into the Gryffindor Tower & Slytherin Dungeon rooms. As well, one will find routes to Diagon Alley, The Burrow of the Weasley family and many other interesting sites & locations. All it takes is a short walk or some floo powder in Hogsmeade to get there. Enjoy.',},[56]={['N']='The House of Sorrows',['C']=1.007000,['O']=19058,['D']='The ancient home of the ��Ash Ahrenshad An Nyéna�� - the Covenant of Sorrows. This delve below the surface has been expanded from a natural cavern to include classrooms, barracks with parlor, kitchens, offices, relic & treasury storage, library & dining, chapel, selpucher & tombs, gardens, prison cells, grotto with steam pool, and a large open amphitheater. The House of Sorrows is open to all; you may check in any time you want, but you may never leave���',},[16]={['N']='THE HARBOURMASTER\"S',['C']=1.007000,['O']=19450,['D']='Hiding on a lower floor of a building next door to the Cathedral, Tavern & Inn of Port Royal, lies the Harbourmaster\\'s Offices. Steps away from both the docks, warehouses and prison nestled inside the Grotto that plays home to this seaport town. The Horbourmaster does their best to monitor the goods & services passing through under their watch. [Interior addon for my Port Royal (grotto) theme which includes Brotherhood/Outlaw Refuge, Captains Quarters, Governors Mansion & more]',},[60]={['N']='PORT ROYAL-CARIBBEAN',['C']=1.007000,['O']=19472,['D']='Inspired by the incrdibly amazing work of both Futerko\\'s Pirate Haven & MLOKing\\'s Church; this town, Port Royal, resides inside a sheltered grotto. Port Royal contains Homes, Tavern with Inn, Harbourmaster’s Office, Cathedral, Blacksmith, Shops, Governors Manor, Captain’s Quarters, Jail, Warehouse, Lighthouse, Assassin’s Order Refuge, Ships to far off ports & more. [Port Royal connects via EHT portals to many other locations & interiors]',},[61]={['N']='RIVENDELL [LOTR]',['C']=1.007000,['O']=19077,['D']='Rivendell was the perfect house, whether you liked food or story-telling or singing, or just sitting & thinking best, or a mix of them all. Merely to be there was a cure for weariness such was the virtue of the land. The future was not forgotten, but ceased to have any power over the present. But autunm was waning fast & slowly the golden light faded while the Hunter\\'s Moon waxed round in the night sky & put to flight all the lesser stars.',},[62]={['N']='CHAMBER OF SECRETS',['C']=1.007000,['O']=19424,['D']='The Chamber of Secrets is a legendary secret room constructed by Salazar Slytherin to house a monster which would finish his ���noble work.” The Chamber is well hidden, the entrance behind a sink in Moaning Myrtle’s bathroom on the 2nd floor & when someone orders “open up” in Parseltongue, the sinks recede exposing an opening to the chamber. This is an addendum for the main Hogwarts build which includes connections to Gryffindor Tower [Domus] Hogsmeade [Globe] The Weasley’s Burrow [Coven] & others',},[63]={['N']='HOGSMEADE VILLAGE',['C']=1.041000,['O']=19402,['D']='Hogsmeade looked like a Christmas card; the little thatched cottages and shops were all covered in a layer of crisp snow; there were holly wreaths on the doors and strings of enchanted candles hanging in the trees.\" Hogsmeade Village is the only all-wizarding village in Tamriel where 3rd years go to visit the shops, buy supplies or travel to Hogwarts School and Diagon Alley from there. [Inspired by some great designers, so many amazing people out there to learn from]',},},['TS']=1698502294,['Key']='oh__@ah\\'satan',['Version']=1773,}"
