R["oh__@heavensenttnt"]="{['TS']=1697700533,['Key']='oh__@heavensenttnt',['Version']=1773,['na']={[56]={['C']=1.050000,['D']='Hidden away in an offshoot of Zainsipilu lies this contemporary Telvanni dwelling illuminated only by scant, errant sunrays. The family that built it grew traditional fungal furniture within minimalist stone architecture to honor their various lineages.',['N']='Modshroom',['O']=19649,},[74]={['C']=1.021000,['D']='A Stonelore retreat deep beneath the ground, built upon the location of a sacred spring. If you\\'re fortunate, you may see some druidic spirits walking beneath and might even catch them surfacing to join our realm for a time.',['N']='Subterranean Spring',['O']=19453,},[44]={['C']=1.031000,['D']='The igloo cave home of a marooned ice fisherman somewhere in remote Solstheim.',['N']='Skaal Retreat',['O']=19450,},[40]={['C']=1.014000,['D']='Grand reopening after renovations!\\n\\nTherme Botanica is a semi-open air botanical spa themed after the three Druid circles. It was built on a volcanic hot spring and offers visitors the ability to enjoy the natural pools in a protected setting. Feel free to move between the various offerings of the connected rooms such as free swim space, lounge areas, and steam chairs.',['N']='Therme Botanica',['O']=19450,},[98]={['C']=1.031000,['D']='Delve into the ruins of an abandoned, seaside Druidic complex. What happened here and why?\\n\\nPlease explore to the best of your abilities as you never know what you might find. Follow the currents to the deep green, discover a pint-sized abode, make an escape from the setting sun, and greet a shy resident high in the sky.\\n\\n(NOTE: It is possible to exit the structure in more than one place and the top of the dome is reachable. Good luck!)',['N']='Skara Verde',['O']=19460,},[15]={['C']=1.021000,['D']='An obscure fruit orchard, distillery, and tasting room in the heart of Grahtwood',['N']='Tropical Spirits',['O']=19450,},},}"
