R["oh__@whasabi"]="{['Version']=1773,['eu']={[16]={['O']=19419,['N']='Daggerfall House',['C']=1.024000,['D']='Its a little tavern, the best beer of all Glenumbra',},[34]={['O']=19425,['N']='Hallin\\'s Stand House',['C']=1.007000,['D']='It\\'s a dragon\\'s lair, be careful with the bones, you could be next if you touch its treasure.',},[19]={['O']=19419,['N']='Kragenmoor House',},[6]={['O']=19425,['N']='Mournhold Apartment',['C']=1.007000,['D']='A small hideout of the Brotherhood, many lives have been trapped behind these walls.\\n\\nSweet Mother, sweet Mother, send your child unto me, for the sins of the unworthy must be baptized in blood and fear.',},[7]={['O']=19425,['N']='Black Vine House',['C']=1.007000,['D']='Druidic dream, It is the house that Y\\'ffre gifted to Madoris Dufoeron while she takes care of his little forest.',},[11]={['O']=19425,['N']='Stormhold House',['C']=1.019000,['D']='A great mechanical creature sprouted from the ground with pincers making balls with the soil\\'s manure',},[28]={['O']=19420,['N']='Nimalten House',['C']=1.020000,['D']='Translated: Dwemer research chamber, with a small garden of Blackreach.',},[31]={['O']=19425,['N']='Hammerdeath House',['C']=1.007000,['D']='The infinite archives of Hermaeus Mora are the ultimate treasure. Its innumerable shelves and countless books carry the weight of all knowledge. Therein, the diligent reader can find all that was, all that is, and all that will be.',},[38]={['O']=19485,['D']='In this Temple to the 8 divines something mysterious happens, (there is a secret room on the stairs to the right, take a step to true knowledge....)',['C']=1.007000,['N']='Daenia Dolmen Manor',},[15]={['O']=19437,['N']='Red Riding Hood\\'s',['C']=1.007000,['D']='Welcome to The Gorinir State! In this video, you can enjoy a unique and exciting experience as you delve into the story of Little Red Riding Hood. Join us on a journey through the enchanted forest where you must choose your path wisely to reach grandmother\\'s house. You will discover mysteries and challenges along the way that will lead you to a surprising ending. Get ready for an unforgettable adventure where you can live the story of Little Red Riding Hood like never before!',},},['TS']=1683556245,['Key']='oh__@whasabi',}"
