izeY']=9,['Y']=22005,['Z']=23740.338540,['Roll']=0,['SizeZ']=9,['Groups']=0,['SizeX']=9,['Color']=0,['Pitch']=0,['X']=32036.057516,['Id']=2736,['EffectType']=513,['Alpha']=0.990000,['Contrast']=1,},[10]={['Yaw']=5.804965,['SizeY']=6,['Y']=22003,['Z']=23574.131197,['Roll']=0,['SizeZ']=6,['Groups']=0,['SizeX']=6,['Color']=0,['Pitch']=0,['X']=32346.799551,['Id']=2795,['EffectType']=513,['Alpha']=0.990000,['Contrast']=1,},[11]={['Yaw']=5.630432,['SizeY']=6,['Y']=22043,['Z']=23609.099089,['Roll']=0,['SizeZ']=6,['Groups']=0,['SizeX']=6,['Color']=0,['Pitch']=0,['X']=32390.539765,['Id']=2796,['EffectType']=513,['Alpha']=0.990000,['Contrast']=1,},[12]={['Yaw']=5.616470,['SizeY']=8,['Y']=21980,['Z']=23637.230844,['Roll']=0,['SizeZ']=8,['Groups']=0,['SizeX']=8,['Color']=0,['Pitch']=0,['X']=32424.382572,['Id']=2797,['EffectType']=513,['Alpha']=0.990000,['Contrast']=1,},[13]={['Yaw']=5.717699,['SizeY']=6,['Y']=22060,['Z']=23629.020627,['Roll']=0,['SizeZ']=6,['Groups']=0,['SizeX']=5,['Color']=0,['Pitch']=0,['X']=32414.473162,['Id']=2798,['EffectType']=513,['Alpha']=0.990000,['Contrast']=1,},[14]={['Yaw']=0.733038,['SizeY']=60,['Y']=21882,['SizeX']=45.456456,['Z']=23824.576219,['Roll']=0,['SizeZ']=60,['Groups']=0,['Color']=294298,['MetaData']={['message']='                         Captains Log \\n\\nDay 1: Set sail from Port in Sentinel after repairs. Several new crew members. The short one looks familiar. I\\'ll have to ask Aliya about the new recruits tomorrow.\\n\\nDay 8: Fair seas. The men pulled something up in the nets, not yet sure what it is. Ships doctor is looking it over.\\n\\nDay 13: Threw the cursed thing overboard. Everything is a mess. The crew are cleaning the hold nonstop. The smell is terrible. Skies are dark on the horizon, may have to pull into port, though far to soon to return to Port Royal yet and we are leagues away.\\n\\nDay 112: Heard some strange noises over the waves. The crew suspected sirens, but looking through the spyglass it was just a particularly large & injured pelican. Nevertheless, we turned to satisfy the more superstitious of the men & mer.\\n\\nDay 167: A raven landed on the deck. We\\'re miles from dry land. It watches me carefully every time I go on deck.\\n\\nDay 222: Spotted a ship, but we had the wind at our back. In due haste we had run her down, boarded and captured her. Now to VVardenfell to sell off the crew to the Dunmer there in Vivec and offload the cargo both in our holds and the new vessel that will fetch a good price. May be time to grant my first mate Aliya her own vessel and to Captain and perhaps I could try on the hat of Commadore or Admiral.\\n\\nDay 356: A good year of of Piracy and trade, Aliya took the captured vessle Rocinate down to Hunding\\'s to offload goods and do some slight refitting of the hull, whilst I have begun the journey back to Port Royal. Bout time to give the crew some time off at the Crown & Lion. But before long we will rejoin the Rocinate with the Arcadia and head off for some real sport at High Isle & Galen.\\n\\n\\n[Many more entries fill the pages inside]',['title']='Journal of Captain Harlock',},['Pitch']=4.712564,['X']=32097.995868,['Id']=2800,['EffectType']=8501,['Alpha']=0.580000,['Contrast']=0.250000,},},['Version']=1773,['TS']=1682259679,}"
