e']=54,['Alpha']=1,['Id']=1130,['Yaw']=0,['Pitch']=0,['Contrast']=1.040000,['X']=0,},[10]={['Roll']=0,['Color']=399953,['Groups']=0,['Z']=54896.175405,['SizeZ']=30,['Y']=29721,['Id']=1166,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['message']='This is a roleplay house in-characterly set in a stretch of forest of Hircine\\'s daedric realm, the Hunting Grounds!\\n\\nIf you follow the path correctly, it should loop you straight back to start - but the path forward may not always be super obvious. Don\\'t be afraid to jump around and try to get creative with how you proceed if you want the full experience.\\n\\nThis house was a labor of love and I hope anyone who visits enjoys it as much as I have.\\n\\nHappy hunting!',['title']='Welcome to Wolf\\'s Fall!',},['Alpha']=1,['Pitch']=0,['Yaw']=3.857178,['EffectType']=8503,['Contrast']=1,['X']=59468.444541,},[11]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=57227.549338,['SizeZ']=30,['Y']=29622,['Id']=1167,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['message']='Took no small mount of effort to finally get here. Hircine\\'s forests are vast, but spose this is just another part of the task at hand. If the words are true, some of Hircine\\'s nastiest wolves dwell here. Would bring me great favor then to complete His hunt and present him the head of one of them wolves.\\n\\nNow I just need to find where the den of the beasts is.',['title']='Hunter\\'s Journal #1',},['Alpha']=1,['Pitch']=4.712564,['Yaw']=3.256784,['EffectType']=8502,['Contrast']=1,['X']=61206.298892,},[12]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=57438.149952,['SizeZ']=30,['Y']=28948,['Id']=1168,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['title']='Hunter\\'s Journal #2',['message']='Well, no one said this would be easy, but was no exaggeration that this place is one o the more dangerous stretches of Hircine\\'s realm. All kinds o big nasty beasties lurking around the murk an the swamps.\\n\\nBeginning to think it aint the wolves that are the biggest prize here, but may be one of the more reasonable ones by comparison. \\n\\nI\\'m sure I can see the path forward from here over them rocks. Big ol goats come and go that way, grazin up on the stuff above, but ain\\'t no way I\\'m swimmin that.\\n\\nThere\\'s all sorts o eyes just waiting to take a snap soon as I touch the water. Lucky I aint lost a limb already. Fog makes it hard to see too. Right frustratin it is, but I\\'m sure the answer\\'ll come to me.',},['Alpha']=1,['Pitch']=4.712564,['Yaw']=5.913176,['EffectType']=8502,['Contrast']=1,['X']=72457.817340,},[13]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=58365.941736,['SizeZ']=30,['Y']=29181,['Id']=1169,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['title']='Hunter\\'s Journal #3',['message']='Seems makin my own walkways cross the trees wasn\\'t a half-bad idea! Most the way at least wheres needed.\\n\\nBlasted goats knocked me off the rocks when I was almost on my path though. Damned things. I\\'ll need to be careful and sneak past, or maybe put a few arrows in em. \\n\\nIf I have to try and cross the water a third time, I think something\\'ll snap me into the deep. The things in the water are gettin wise about me and I can feel em moving all around waiting for a bite even if I can\\'t see em under this fog.',},['Alpha']=1,['Pitch']=5.061455,['Yaw']=3.169518,['EffectType']=8502,['Contrast']=1,['X']=80005.180392,},[14]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=66434.392092,['SizeZ']=30,['Y']=29229,['Id']=1170,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['title']='Hunter\\'s Journal #4',['message']='Fuckin bloody pack of boars! I\\'d rather have faced wolves!\\n\\nDamn things chased me up the cliffs an I fell right through this crevice. Parently wasn\\'t one of the only ones if the skeletons are anything to go by. Just glad whatever beast used to be down here is one of them.\\n\\nBoars must\\'ve known this was here cuz not a one followed me down the hole. That or they\\'re just smarter than I am. Pah.\\n\\nAnkle hurts something awful. Definitely won\\'t be climbin out and I don\\'t think the vines will hold me anyway. Hopin I don\\'t die here, but there\\'s gotta be a way.',},['Alpha']=1,['Pitch']=4.712564,['Yaw']=2.921681,['EffectType']=8502,['Contrast']=1,['X']=65549.299001,},[15]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=67215.782562,['SizeZ']=30,['Y']=29229,['Id']=1171,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['title']='Hunter\\'s Journal #5',['message']='Caves is like a maze and of course the only way out of here sides climbing is guarded by a big ol nasty tiger with bigger teeth than I\\'ve ever seen. Would be just my luck.\\n\\nI\\'ll have to do this smart. I aint in much of a shape to be fighting something like that, specially alone.',},['Alpha']=1,['Pitch']=4.712564,['Yaw']=0.253073,['EffectType']=8502,['Contrast']=1,['X']=63478.424801,},[16]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=72765.378939,['SizeZ']=30,['Y']=29233,['Id']=1172,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['title']='Hunter\\'s Journal #6',['message']='I\\'m close now to the prize! Big and beautiful black wolf with the reddest eyes I\\'ve ever seen. Saw it come and go through the brush. Looks to be a small cave up ahead, but I aint dared go in yet. Gonna hang back and watch for a while, figure out its patterns and pray it don\\'t notice me til I\\'m ready for it.',},['Alpha']=1,['Pitch']=4.712564,['Yaw']=3.914774,['EffectType']=8502,['Contrast']=1,['X']=63618.736638,},[17]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=77331.717836,['SizeZ']=30,['Y']=28988,['Id']=1173,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['title']='Hunter\\'s Journal #7',['message']='After a long and harrowing fight, the head of the wolf is finally mine! But I\\'ve not the strength to fight my way back again past all the other beasts. \\n\\nMust be another way out of this place. If I can get up on the rocks above maybe, can avoid the rest of the nasties altogether and present my prize to the Huntfather.\\n\\nHircine give me strength to make it to the end of my quest. I will need it.',},['Alpha']=1,['Pitch']=4.719370,['Yaw']=1.776745,['EffectType']=8502,['Contrast']=1,['X']=64521.178971,},[18]={['Roll']=0,['Color']=102439,['Groups']=0,['Z']=61005.908510,['SizeZ']=30,['Y']=30894,['Id']=1174,['SizeX']=26.456456,['SizeY']=30,['MetaData']={['title']='Hunter\\'s Journal #8',['message']='I finally did it. I presented the head of my prize to the Huntfather, and he was pleased with my hunt. I had conquered all that this forest had to put in my way, I tracked my quarry, and I became the greater Hunter.\\n\\nHircine has declared me Champion of this forest. A new wolf must stand in its place, and so this will be my last entry. \\n\\nA wolf has no need of a pen, only tooth and claw, and I dare any others come who think they can best me.',},['Alpha']=1,['Pitch']=4.597197,['Yaw']=3.096214,['EffectType']=8502,['Contrast']=1,['X']=60609.633378,},},['TS']=1672539242,['Version']=1771,}"
