3,['EffectType']=5064,['Yaw']=0.106465,['Y']=48065,['SizeZ']=160,['Alpha']=1,['Pitch']=0,['Id']=1072,['Groups']=0,['SizeY']=160,},[16]={['Contrast']=1,['Z']=66365,['X']=19491,['Roll']=0,['MetaData']={['message']='Greetings, Walker! What can this one fetch for you? A hot meal? A home-brewed Reach cider?',['name']='Temple Chef',},['SizeX']=106.716418,['Color']=999999,['EffectType']=5066,['Yaw']=0.083776,['Y']=32695,['SizeZ']=260,['Alpha']=1,['Pitch']=0,['Id']=1074,['Groups']=0,['SizeY']=260,},[17]={['Contrast']=1,['Z']=62153,['X']=22232,['Roll']=0,['MetaData']={['message']='  Hub Discord:\\ndiscord.gg/Q9w3g9bUm8\\n\\n\\n\\n\\n  House Rules:\\n\\n    -No ERP\\n\\n  -Treat others \\n   respectfully\\n\\n   -Homeowner\\'s\\n(the-cawckiest.king)\\n word is law here',},['SizeX']=102,['Color']=999998,['EffectType']=4402,['Yaw']=1.790708,['Y']=32053,['SizeZ']=202,['Alpha']=1,['Pitch']=0,['Id']=1076,['Groups']=0,['SizeY']=202,},[18]={['Contrast']=1,['Z']=62403,['X']=22445,['Roll']=0,['MetaData']={['message']='If you would like to join\\n our Nocturnal mercenary\\n guild, whisper or mail\\n  @the-cawckiest.king',},['SizeX']=180,['Color']=999999,['EffectType']=4405,['Yaw']=2.553417,['Y']=32037,['SizeZ']=40,['Alpha']=1,['Pitch']=0,['Id']=1079,['Groups']=0,['SizeY']=40,},[19]={['Contrast']=1,['Z']=62153,['X']=22232,['Roll']=0,['MetaData']={['message']='Roleplay happening\\n  every sunday at\\n5pm PST/8pm EST',},['SizeX']=102,['Color']=999998,['EffectType']=4402,['Yaw']=1.790708,['Y']=32193,['SizeZ']=30,['Alpha']=1,['Pitch']=0,['Id']=1132,['Groups']=0,['SizeY']=30,},[20]={['Contrast']=1,['Z']=60340.153407,['X']=24151.633979,['Roll']=0,['MetaData']={['title']='OOC - Welcome! Please Read!',['message']='Welcome to Markarth\\'s Nocturnal Temple, owned and hosted by the Kråke Clan, otherwise sometimes called the Crowtongue Clan!\\n\\nThis is a roleplay hub house open to the greater RP community, which serves multiple functions: a place to worship and revere the Daedric Prince, Nocturnal ; a tavern for food and drink ; a refuge for those who work in the shadows to meet and befriend others of similar profession, as well as form groups or plan shady business in relative peace and safety! Its a pleasure to have you!\\n\\nRegular meet-ups are scheduled for every Sunday, 5pm PST / 8pm EST and onward, events going for as long as people are around and interested in doing some roleplay! No guild membership required!\\n\\nWe also have a discord boasting over 75 members for networking with others who have an interest in shady roleplay! \\nhttps://discord.gg/Q9w3g9bUm8\\n\\nAll are welcome so long as you show respect to fellow roleplayers, and we have zero tolerance for drama or bigoted behavior.\\n\\nLikewise, if you ARE interested in guild membership to our Reach-y Nocturnal Mercenary band, feel free to reach out to @the-cawckiest.king to join!\\n\\nShadows Keep You,\\nThe Crow King of the Reach',},['SizeX']=39.456456,['Color']=484318,['EffectType']=8503,['Yaw']=1.144936,['Y']=32017,['SizeZ']=50,['Alpha']=1,['Pitch']=4.712564,['Id']=1159,['Groups']=0,['SizeY']=50,},[21]={['Contrast']=1,['Z']=60287.277522,['X']=24183.278546,['Roll']=0,['MetaData']={['title']='History of the Temple',['message']='In 2E 588, news spread of a plight ravaging the northern lands of Western Skyrim and the Reach, supernatural storms that killed most in its path, and what it didn\\'t kill, it turned into bloodfiends or mindless husks.\\n\\nThe Kråke Clan - a mercenary company led by a small Reachman - came to the north about this time to fight the threat and uncover schemes by the Gray Host, a legion of vampires and werewolves.\\n\\nThrough investigation and struggle, the Clan heavily aided the region in overcoming the Harrowstorm threat and its leaders. \\n\\nA few short months following just before 2E 589, another crisis threatened the north, a Malacath cult known as the Nozarga that led Reachfolk, Nords, and Orcs alike to band together en masse as allies in a war that stretched half a year. The Kråke were among them, led by a man in a mask who most simply called the Crow-King.\\n\\nFollowing both these wars, the Ard, wanting to keep such a useful Clan close at hand, offered this very building to them. \\n\\nFinding it too large for their usual purposes, the leadership decided to turn the empty structure into the temple you see before you now. \\n\\nThe Temple stands as a unique place for daedra-worshippers that only the Reach can provide, and a safe haven for those whose path follows the voice of Ur\\'dra - the Original Dark.',},['SizeX']=39.456456,['Color']=995779,['EffectType']=8503,['Yaw']=1.675516,['Y']=32017,['SizeZ']=50,['Alpha']=1,['Pitch']=4.712564,['Id']=1160,['Groups']=0,['SizeY']=50,},[22]={['Contrast']=1,['X']=24151.195289,['Z']=60310.232037,['Roll']=0,['SizeX']=60,['Color']=993760,['EffectType']=7,['Yaw']=1.462586,['Y']=32021,['SizeZ']=80,['Alpha']=1,['Pitch']=1.570971,['Id']=1162,['Groups']=0,['SizeY']=80,},[23]={['Contrast']=1.420000,['X']=17495.831092,['Z']=61087.021805,['Roll']=0,['SizeX']=500,['Color']=360413,['EffectType']=4592,['Yaw']=0.373500,['Y']=33271,['SizeZ']=460,['Alpha']=0.750000,['Pitch']=0,['Id']=1165,['Groups']=0,['SizeY']=460,},},}"
