R["oh__@horsetwin"]="{['TS']=1660442811,['na']={[14]={['D']='Welcome to Eylaelith\\'s brewery. She let her magic get a little bit too crazy in her landscaping, but her rotmeth is still top notch. Look for the secret entrance, and you\\'ll discover the secret to her brew. But beware, there are always competitors trying to source her secrets. Eylaelith is also trying to find a precious sweetroll she lost while climbing a tree. The sweetroll is in a location no one would think to look.',['N']='Longhaven House',['C']=1.021000,['O']=18895,},[90]={['D']='Inspired by Haj Uxith in Coldharbour, welcome to an argonian village (and an unfortunate khajiit caravan) sucked into the Deadlands by Mehrunes Dagon. Discover why the village has survived to this day, and what life is like for inhabitants of the village.',['N']='Deadlands Plot',['C']=1.041000,['O']=19186,},[83]={['D']='Welcome to my spa! I built this because I missed my favorite Korean Spa during quarantine. Here you\\'ll find a bathhouse (please shower before entering), sauna, cafeteria, spa rooms, pools, massage parlor, and guest suites. You may also find where the caretaker of the grounds live.\\n\\nThe showers in the bathhouse work! Just look up to turn them on/off.',['N']='Markarth Manor',['C']=1.014000,['O']=18933,},},['Key']='oh__@horsetwin',['Version']=1769,}"
