R["oh__@uofmmike2000"]="{['na']={[64]={['O']=18978,['D']='Welcome to the Murkmire Aquarium. Take some time to look around, and of your feeling sleepy, take a nap down in the Crypt for the Argonian Kings.  They dont make any noises, I think.  Be careful of the collapsing tunnels above, they seem to have attracted some uninvited guests.   But enjoy the peaceful views!!',['C']=1.012000,['N']='Murkmire Pyramid',},[49]={['O']=18936,['D']='',['C']=1.038000,['N']='Witches Cottage',},[56]={['O']=18978,['D']='Welcome to the Dark Brotherhood Erstwhile Sanctuary.  I am Arterial Hemorrhage, the Silent One for the BrotherHood.   I decided to move back to our Older Sanctuary due to memories that wont go away.  I have killed more than any one should!! I have never found happiness in it, only pleasure.  I took my time and slowly created a home for all those lost in their memories, but alas, no more.  We shall hunt together my brother and sisters, come join me in Death, Slowly Worshipping Sithis in our minds',['C']=1.037000,['N']='Arterial\\'s Sanctuary',},[89]={['O']=18944,['D']='War has come to Blackwood!!  The Aldmeri Guild \\'The Havoc Squad\\' has returned to the Hounds of War Cathedral to prepare for the Invasion.  ALL of Blackwood will be destroyed if they allow the Daggerfall Covenant or the EbonHeart Pact to get through the ONLY Fort standing in their way.  \"CRY HAVOC and let live the Dogs of War\"',['C']=1.017000,['N']='Blackwood Chapel',},[90]={['O']=18991,['D']='Welcome to DoomChar Arena.  This is where you either Kill or Be Killed.  Dont be shy, they are not watching you!! ',['C']=1.001000,['N']='Deadlands Arena',},[59]={['O']=18903,['D']='',['C']=1.021000,['N']='Alinor House',},[77]={['O']=18978,['D']='Welcome to the Dark Brotherhood Erstwhile Sanctuary.  I am Arterial Hemorrhage, the Silent One for the BrotherHood.   I decided to move back to our Older Sanctuary due to memories that wont go away.  I have killed more than any one should!! I have never found happiness in it, only pleasure.  I took my time and slowly created a home for all those lost in their memories, but alas, no more.  We shall hunt together my brother and sisters, come join me in Death, Slowly Worshipping Sithis in our minds',['C']=1.037000,['N']='Solitude Inn',},[74]={['O']=18978,['D']='Welcome to Kashmiir Estate, Home to Bloody Menace to Society.  This one knows how to live like a Khajiit should, No?  This one has worked hard to provide all the crafting needs for anyone who loves to craft special toys for all Kittens to play with!!  This one knows how to party as well, with an outdoor privacy area for all your kitten pleasures, like slightly frozen fish and delights, as a King would want, No?  Stay and enjoy life, but be careful, Hissss Dragons Have Come to Elsweyr!!',['C']=1.021000,['N']='Kashmiir Estate',},[79]={['O']=18915,['D']='Castle Ravenloft.  Home to Count Strahd Von Zarovich, the Demiplane Master.   His love for Tatyana pushed him to pursue her to Tamriel, and to begin his conquering of the underdark here in Blackreach.  \" I am the Ancient, I am the Land. My beginnings are lost in the darkness of the past. I am not dead. Nor am I alive. I am undead, forever.\"  - Tome of Strahd. ',['C']=1.048000,['N']='Castle Ravenloft',},},['Key']='oh__@uofmmike2000',['TS']=1640898026,['Version']=1767,}"
