R["oh__@jet_korro"]="{['Version']=1767,['na']={[47]={['O']=19041,['N']='Descent Into Madness',['D']='The \"Descent into Madness\" is a Ninja Warrior inspired parkour course with 16 stages, each focusing on a different aspect of ESO parkour. Often dubbed as \"the vMA of parkour\", this course typically takes between 2-4 hours to complete on first attempt but can be completed in under 10 minutes on a near perfect speed run with base speed.',['C']=1.005000,},},['TS']=1645208112,['Key']='oh__@jet_korro',}"
